import React from "react";
import "./TaskBoard.css";
import Card from "./Card";
function TaskBoard() {
  return (
    <div>
      <div className="taskNav">
        <img src="taskLogo.png" alt="task-logo" />
        <h1>Task Board </h1>
        <input type="button" value="Add Task" />
      </div>
      <div className="Task-container">
        <Card/>

        <div className="test">
          <input type="checkbox" />
          <h4>22/10/2024</h4>
          <p>this is notes</p>
          <img src="edit.jpeg" alt="edit" className="edit" />
          <img src="delete.png" alt="delete" className="delete" />
        </div>
      </div>
    </div>
  );
}

export default TaskBoard;
